import csv

def csv_to_dict(file_path):
    data = []
    with open(file_path, 'r') as csv_file:
        csv_reader = csv.DictReader(csv_file)
        for row in csv_reader:
            data.append(row)
    return data

file_path = 'Crops diseases information.csv'
csv_data = csv_to_dict(file_path)
print(csv_data)



